import React from 'react';

export default class Cadastro extends React.Component {
  constructor() {
    super();

    this.state = {
      name: '',
      email: '',
      age: 0,
      password: '',
    }
  }

  render() {
    return (
      <fieldset>
        <form>
          <label>
            Nome:
            <input name="name" type="text" required />
          </label>
          <br />
          <label>
            E-mail:
            <input type="email" required />
          </label>
          <br />
          <label>
            Idade:
            <input type="number" required />
          </label>
          <br />
          <label>
            Senha:
            <input type="password" required />
          </label>
        </form>
      </fieldset>
    );
  }
}
